import { useDispatch, useSelector } from 'react-redux'
import React, { useEffect, useState } from 'react'
import { useParams } from 'react-router-dom';
import axios from 'axios';
import { setSelectorProdact } from '../redux/reducers/selectProdact';

function ProductDetails() {
    const selectrProduct = useSelector(state => state.selectProduct.obj)
    const dispatch = useDispatch();
    const { productId } = useParams()
    const [isLoded,setIsLoded]= useState(flase)
    useEffect(() => {
        axios
            .get(`https://fakestoreapi.com/products/${productId}`)
            .then(res => {
                dispatch(setSelectorProdact(res.data))
                // console.log(res.data)
            })
    })
    return (
        <>
            {selectrProduct ?
                (<h1>{selectrProduct.title}</h1>)
                :
                (<h1 className='text-center'>Loading...</h1>)
            }
        </>
    )
}

export default ProductDetails
